// Look for athlete card and click to view stats
cy.get('[data-testid="athlete-card"]').first().then(function ($card) {
    if ($card.length > 0) {
        // Click on stats link/button
        cy.wrap($card).find('a, button').filter(':contains("Stats"), :contains("Statistiche")').then(function ($statsBtn) {
            if ($statsBtn.length > 0) {
                cy.wrap($statsBtn).first().click({ force: true });
                cy.wait(500);
                // Verify navigation to stats page
                cy.url().should('include', '/stats');
            }
        });
    }
});

